COPY services ("ID_service", services_name, services_description) FROM stdin;
1	Servicio de radiocomunicacin                                                                                                   	Servicio definido en esta seccin que implica la transmisin, la emisin o la recepcin de ondas radioelctricas para fines especficos de telecomunicacin.                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                    
2	Servicio Fijo                                                                                                                   	Servicio de radiocomunicacin entre puntos fijosdeterminados.                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                   
3	Servicio Fijo por satlite                                                                                                      	Servicio de radiocomunicacin entre estaciones terrenas situadas en emplazamientos dados cuando se utilizan uno o ms satlites; el emplazamiento dado puede ser un punto fijo determinado o cualquier punto fijo situado en una zona determinada; en algunos casos, este Servicio incluye enlaces entre satlites que pueden realizarse tambin dentro del  Servicio entre satlites; el Servicio Fijo por satlite puede tambin incluir  enlaces de conexin para otros servicios de radiocomunicacin espacial.                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                             
4	Servicio entre satlites                                                                                                        	Servicio de radiocomunicacin que establece enlaces entre satlites artificiales.                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                               
5	Servicio de operaciones espaciales                                                                                              	Servicio de radiocomunicacin que concierne exclusivamente al funcionamiento de los vehculos espaciales, en particular el seguimiento espacial, la telemedida espacial y el telemando espacial.                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                
6	Servicio Mvil                                                                                                                  	Servicio de radiocomunicacin entre estaciones mviles y estaciones terrestres o entre estaciones mviles (CV).                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                 
7	Servicio Mvil por satlite                                                                                                     	Servicio de radiocomunicacin:\n entre estaciones terrenas mviles y una o varias estaciones espaciales o entre estaciones espaciales utilizadas por este Servicio; o\n entre estaciones terrenas mviles por intermedio de una o varias  estaciones espaciales.\nTambin pueden considerarse incluidos en este Servicio los enlaces de conexin necesarios para su explotacin.                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                 
8	Servicio Mvil terrestre                                                                                                        	Servicio Mvil entre estaciones de base y estaciones mviles terrestres o entre estaciones mviles terrestres.                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                  
9	Servicio Mvil terrestre por satlite                                                                                           	Servicio Mvil por satlite en el que  las estaciones terrenas mviles estn situadas en tierra.                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                
10	Servicio Mvil Martimo                                                                                                         	Servicio Mvil entre estaciones costeras y estaciones de barco, entre estaciones de barco, o entre estaciones de comunicaciones a bordo asociadas; tambin pueden considerarse incluidas en este Servicio las estaciones de embarcacin o dispositivo de salvamento y las estaciones de radiobaliza de localizacin de siniestros.                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                              
11	Servicio Mvil Martimo por satlite                                                                                            	Servicio Mvil por satlite en el que  las estaciones terrenas mviles estn situadas a bordo de barcos; tambin pueden considerarse incluidas en este Servicio las estaciones de embarcacin o  dispositivo de salvamento y las estaciones de radiobaliza de localizacin de  siniestros.                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                      
12	Servicio de operaciones portuarias                                                                                              	Servicio Mvil Martimo en un  puerto o en sus cercanas, entre estaciones costeras y estaciones de barco, o  entre estaciones de barco, cuyos mensajes se refieren nicamente a las  operaciones, movimiento y seguridad de los barcos y, en caso de urgencia, a la salvaguardia de las personas.Quedan excluidos de este Servicio los mensajes con carcter de correspondencia pblica.                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                       
13	Servicio de movimiento de barcos                                                                                                	Servicio de seguridad, dentro del Servicio Mvil Martimo, distinto del Servicio de operaciones portuarias, entre estaciones costeras y estaciones de barco, o entre estaciones de barco, cuyos\nmensajes se refieren nicamente a los movimientos de los barcos. Quedan excluidos de este Servicio los mensajes con carcter de correspondencia pblica.                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                        
14	Servicio Mvil aeronutico                                                                                                      	Servicio Mvil entre estaciones aeronuticas y estaciones de aeronave, o entre estaciones de aeronave, en el que tambin pueden participar las estaciones de embarcacin o dispositivo de salvamento; tambin pueden considerarse incluidas en este Servicio las estaciones de radiobaliza de localizacin de siniestros que operen en las frecuencias de socorro y de urgencia designadas.                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                     
15	Servicio Mvil aeronutico en rutas (R)                                                                                         	Servicio Mvil aeronutico reservado a  las comunicaciones aeronuticas relativas a la seguridad y regularidad de los  vuelos, principalmente en las rutas nacionales o internacionales de la aviacin civil.                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                   
16	Servicio Mvil aeronutico fuera de rutas (OR)                                                                                  	Servicio Mvil aeronutico destinado  a asegurar las comunicaciones, incluyendo las relativas a la coordinacin de los  vuelos, principalmente fuera de las rutas nacionales e internacionales de la aviacin civil.                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                            
17	Servicio Mvil aeronutico por satlite                                                                                         	Servicio Mvil por satlite en el  que las estaciones terrenas mviles estn situadas a bordo de aeronaves;  tambin pueden considerarse incluidas en este Servicio las estaciones de  embarcacin o dispositivo de salvamento y las estaciones de radiobaliza de   localizacin de siniestros.                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                 
18	Servicio Mvil aeronutico en rutas (R) por satlite                                                                            	Servicio Mvil aeronutico por  satlite reservado a las comunicaciones relativas a la seguridad y regularidad de  los vuelos, principalmente en las rutas nacionales o internacionales de la aviacin civil.                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                   
19	Servicio Mvil aeronutico fuera de rutas (OR) por satlite                                                                     	Servicio Mvil aeronutico por  satlite destinado a asegurar las comunicaciones, incluyendo las relativas a la  coordinacin de los vuelos, principalmente fuera de las rutas nacionales e  internacionales de la aviacin civil.                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                              
20	Servicio de Radiodifusin                                                                                                       	Servicio de radiocomunicacin cuyas emisiones se destinan a ser recibidas directamente por el pblico en general. Dicho Servicio abarca emisiones sonoras, de televisin o de otro gnero (CS).                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                 
21	Servicio de Radiodifusin por satlite                                                                                          	Servicio de radiocomunicacin en el cual las seales emitidas o retransmitidas por estaciones espaciales estn  destinadas a la recepcin directa por el pblico en general.  En el Servicio de Radiodifusin por satlite la expresin recepcin directa abarca tanto la recepcin individual como la recepcin comunal.                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                     
22	Servicio de radiodeterminacin                                                                                                  	Servicio de radiocomunicacin para fines de radiodeterminacin.                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                 
23	Servicio de radiodeterminacin por satlite                                                                                     	Servicio de radiocomunicacin para fines de radiodeterminacin, y que implica la  utilizacin de una o ms estaciones espaciales. Este Servicio puede incluir tambin los enlaces de conexin necesarios para su funcionamiento.                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                
24	Servicio de radionavegacin                                                                                                     	Servicio de radiodeterminacin para fines de radionavegacin.                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                   
25	Servicio de radionavegacin por satlite                                                                                        	Servicio de radiodeterminacin por satlite para fines de radionavegacin. Tambin pueden considerarse incluidos en este Servicio los enlaces de conexin necesarios para su explotacin.                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                       
26	Servicio de radionavegacin martima                                                                                            	Servicio de radionavegacin destinado a los barcos y a su explotacin en condiciones de seguridad.                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                              
27	Servicio de radionavegacin martima por satlite                                                                               	Servicio de radionavegacin por satlite en el que las estaciones terrenas estn situadas a  bordo de barcos.                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                   
28	Servicio de radionavegacin aeronutica                                                                                         	Servicio de radionavegacin destinado a las aeronaves y a su explotacin en condiciones de seguridad.                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                           
29	Servicio de radionavegacin aeronutica por satlite                                                                            	 Servicio deradionavegacin por satlite en el que las estaciones terrenas estn situadas a bordo de aeronaves.                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                 
30	Servicio de radiolocalizacin                                                                                                   	Servicio de radiodeterminacin para fines de radiolocalizacin.                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                 
31	Servicio de radiolocalizacin por satlite                                                                                      	Servicio radiodeterminacin por satlite utilizado para la radiolocalizacin. De Este Servicio puede incluir asimismo los enlaces de conexin necesarios para su explotacin.                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                   
32	Servicio de ayudas a la meteorologa                                                                                            	Servicio de radiocomunicacin destinado a las observaciones y sondeos utilizados en meteorologa, con inclusin de la hidrologa.                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                               
33	Servicio de exploracin de la Tierra por satlite                                                                               	Servicio de radiocomunicacin entre estaciones terrenas y una o varias estaciones espaciales que puede incluir enlaces entre estaciones espaciales y en el que:\n  se obtiene informacin sobre las caractersticas de la Tierra y sus  fenmenos naturales, incluidos datos relativos al estado del medio ambiente, por medio de sensores activos o de sensores pasivos a bordo de satlites de la Tierra;\n se rene informacin anloga por medio de plataformas situadas en el aire o sobre la superficie de la Tierra;\n dichas informaciones pueden ser distribuidas a estaciones terrenas dentro de un mismo sistema;\n puede incluirse asimismo la interrogacin a las plataformas.Este Servicio puede incluir tambin los enlaces de conexin necesarios\npara su explotacin.                                                                                                                                                                                                                                                                          
34	Servicio de meteorologa por satlite                                                                                           	Servicio de exploracin de la Tierra por satlite con fines meteorolgicos.                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                     
35	Servicio de frecuencias patrn y de seales horarias                                                                            	 Servicio de radiocomunicacin para la transmisin de frecuencias especificadas, de seales horarias, o de ambas, de reconocida y elevada precisin, para fines cientficos, tcnicos y de otras clases, destinadas a la recepcin general.                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                     
36	Servicio de frecuencias patrn y de seales horarias por satlite                                                               	Servicio de radiocomunicacin que utiliza estaciones espaciales situadas en satlites de la Tierra para los mismos fines que el Servicio de frecuencias patrn y de  seales horarias. Este Servicio puede incluir tambin los enlaces de conexin necesarios para su explotacin.                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                              
37	Servicio de investigacin espacial                                                                                              	Servicio de radiocomunicacin que utiliza vehculos espaciales u otros objetos espaciales para fines de investigacin cientfica o tecnolgica.                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                 
38	Servicio de aficionados                                                                                                         	Servicio de radiocomunicacin que tiene por objeto la instruccin individual, la intercomunicacin y los estudios tcnicos, efectuado por aficionados, esto es, por personas debidamente autorizadas que se  interesan en la radiotecnia con carcter exclusivamente personal y sin fines de lucro.                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                             
39	Servicio de aficionados por satlite                                                                                            	Servicio de radiocomunicacin que utiliza estaciones espaciales situadas en satlites de la Tierra para los mismos fines que el Servicio de aficionados.                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                        
